import React from "react";
import { NativeBaseProvider } from "native-base";
import {
  Banner,
  IconContainer,
  InnerContainer,
  StyledButton,
  StyledContainer,
  BannerLogo,
  BannerTitle,
  TransparentButton,
  SimpleButtonText,
  ItemText,
  SubTitle,
  PageHeader,
  RightIcon,
  LeftIcon,
  StyledInputLabel,
  StyledFormArea,
} from "../components/styles";
import {
  SafeAreaView,
  StatusBar,
  TouchableOpacity,
  View,
  Text,
} from "react-native";
import { ButtonText, Line } from "../components/styles";
import { Octicons, FontAwesome5 } from "@expo/vector-icons";
import { Colors, PageTitle } from "../components/styles";

import { NavigationContainer } from "@react-navigation/native";
import { createDrawerNavigator } from "@react-navigation/drawer";
import Login from "./Login";
import { alignSelf, justifyContent } from "styled-system";

const { primary, brand, tertiary, darkLight } = Colors;

const ViewInformation = () => {
  return (
    <NativeBaseProvider>
      <StyledContainer>
        <StatusBar style="dark" />
        <InnerContainer>
          <Banner>
            <BannerLogo
              resizeMode="cover"
              source={require("./../assets/img/page_logo.png")}
            />
            <BannerTitle
              resizeMode="cover"
              source={require("./../assets/img/page_title.png")}
            />
          </Banner>
          <PageHeader>Primary Information</PageHeader>
          <Line></Line>
          <MyInfo label={'ID Number:'} value={'XXXXXXXXXXX'} />
          <Line></Line>
          <MyInfo label={'Full Name:'} value={'Juan dela Cruz'} />
          <Line></Line>
          <MyInfo label={'Date of Birth:'} value={'MM-DD-YY'} />
          <Line></Line>
          <MyInfo label={'Date Coverage:'} value={'MM-DD-YY'} />
          <Line></Line>
        </InnerContainer>
      </StyledContainer>
    </NativeBaseProvider>
  );
};

const MyInfo = ({label, value}) => {
    return (
        <View
        style={{
          flexDirection: "column",
          alignSelf: "flex-start",
        }}
      >
        <ItemText>{label}</ItemText>
        <ItemText style={{ marginLeft: 20, marginTop: 10 }}>
          {value}
        </ItemText>
      </View>
    );
};

export default ViewInformation;
